import React, { Component } from "react";

class AudioPlayer extends Component {
  render() {
    return (
      <audio controls>
        <source src={this.props.audiopath} type="audio/ogg" />
        <source src={this.props.audiopath} type="audio/mpeg" />
      </audio>
    );
  }
}

export default AudioPlayer;
